import "./styles.css";
const Card = ({ card }) => {
  console.log(card);
  const { full_name, description, organization } = card;

  return (
    <div className="cards">
      {organization !== null ? (
        <img alt={full_name} src={{ organization }.avatar_url}></img>
      ) : null}

      <h3>titulo repo : {full_name}</h3>
      <h3>{description}</h3>
    </div>
  );
};

export default Card;
